import React from "react";
import List from "./List";

const SearchBar = () => {
  return (
    <div className="SearchBar-container">
      <div className="SearchBar">
        <input type="text" placeholder="Chercher une paroisse" />
      <List />
      </div>
    </div>
  );
};

export default SearchBar;
